import React from "react";

type PictureComponentProps = {
    defaultPicture: boolean;
    className?: string;
};

export const Pictures: React.FC<PictureComponentProps> = ({defaultPicture, className}) => {
    const pictures = [
        "data:image/jpeg;base64,",
        "data:image/jpeg;base64,",
        "data:image/jpeg;base64,",
    ];
    const getRandomPicture = () => {
        const randomIndex = Math.floor(Math.random() * pictures.length);
        return pictures[randomIndex];
    };

    const pictureToShow = defaultPicture ? "data:image/svg+xml;base64," : getRandomPicture();

    return (
        <img src={pictureToShow} className={className} alt={"Default Picture"}/>
    );
};


